import React, { Component } from 'react';


class Dice extends Component{
    constructor(props){
        super(props)
        this.state = {
            diceNum: 1
        }
    }

    rolldice = () => {
        let { diceNum } = this.state
        let random = Math.Floor(Math.Random()*6+1)
        this.setState = ({diceNum: random})

    }


    render() {
        let { diceNum } = this.state
        return(
            <div>
                <div>
                    <h3>{this.diceNum}</h3>
                </div>
            </div>
        );
    }
}

export default Dice
